B.RB=new A.d(B.c,["\u0928 \u091a \u092e\u093e\u092e\u094d \u0924\u093e\u0928\u093f \u0915\u0930\u094d\u092e\u093e\u0923\u093f \u0928\u093f\u092c\u0927\u094d\u0928\u0928\u094d\u0924\u093f \u0927\u0928\u0928\u094d\u091c\u092f \u0964\n\u0909\u0926\u093e\u0938\u0940\u0928\u0935\u0926\u093e\u0938\u0940\u0928\u092e\u094d \u0905\u0938\u0915\u094d\u0924\u092e\u094d \u0924\u0947\u0937\u0941 \u0915\u0930\u094d\u092e\u0938\u0941 \u0965 \u096f \u0965","Arjuna, those deeds do not bind Me. Being neutral, I have no attachment towards those deeds."],t.w)
