B.P5=new A.d(B.c,["\u0928 \u0930\u0942\u092a\u092e\u094d \u0905\u0938\u094d\u092f\u0947\u0939 \u0924\u0925\u094b\u092a\u0932\u092d\u094d\u092f\u0924\u0947 \n\u0928\u093e\u0928\u094d\u0924\u094b \u0928 \u091a\u093e\u093d\u0926\u093f\u0903 \u0928 \u091a \u0938\u092e\u094d\u092a\u094d\u0930\u0924\u093f\u0937\u094d\u0920\u093e \u0964","Over here, the form of this tree is not apparent in the manner described before. We cannot see its end, its beginning, or the basis for its continued existence."],t.w)
