B.R1=new A.d(B.c,["\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0909\u0935\u093e\u091a -\n\u0924\u094d\u0930\u093f\u0935\u093f\u0927\u093e \u092d\u0935\u0924\u093f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0926\u0947\u0939\u093f\u0928\u093e\u092e\u094d \u0938\u093e \u0938\u094d\u0935\u092d\u093e\u0935\u091c\u093e \u0964\n\u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915\u0940 \u0930\u093e\u091c\u0938\u0940 \u091a\u0948\u0935 \u0924\u093e\u092e\u0938\u0940 \u091a\u0947\u0924\u093f \u0924\u093e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u0968 \u0965","The Lord said - Those who own a body have focus of three types: serene, resourceful and lazy. It comes from their own state of being. Listen to them."],t.w)
B.JL=new A.d(B.c,["\u0938\u0924\u094d\u0935\u093e\u0928\u0941\u0930\u0942\u092a\u093e \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u092d\u0935\u0924\u093f \u092d\u093e\u0930\u0924 \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092e\u092f\u094b \u0905\u092f\u092e\u094d \u092a\u0941\u0930\u0941\u0937\u094b \u092f\u094b \u092f\u0924\u094d \u0936\u094d\u0930\u0926\u094d\u0927\u0903 \u0938 \u090f\u0935 \u0938\u0903 \u0965 \u0969 \u0965","Arjuna, each person's focus is according to the essence of his character. This person is defined by his focus. Whoever has a focus, he is that itself."],t.w)
B.KM=new A.d(B.c,["\u092f\u091c\u0902\u0924\u0947 \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915\u093e \u0926\u0947\u0935\u093e\u0928\u094d \u092f\u0915\u094d\u0937 \u0930\u0915\u094d\u0937\u093e\u0902\u0938\u093f \u0930\u093e\u091c\u0938\u093e\u0903 \u0964\n\u092a\u094d\u0930\u0947\u0924\u093e\u0928\u094d \u092d\u0942\u0924\u0917\u0923\u093e\u0928\u094d \u091a\u093e\u0928\u094d\u092f\u0947 \u092f\u091c\u0928\u094d\u0924\u0947 \u0924\u093e\u092e\u0938\u093e\u0903 \u091c\u0928\u093e\u0903 \u0965 \u096a \u0965","People in whom sattva is predominant devote themselves to those who follow the Lord's instructions. People who have a predominance of rajas go behind illusive powers, which they believe will guard and protect them. Other people with tamas get devoted to the deceased spirits and other superstitions."],t.w)
B.NG=new A.d(B.c,["\u0905\u0936\u093e\u0938\u094d\u0924\u094d\u0930\u0935\u093f\u0939\u093f\u0924\u092e\u094d \u0918\u094b\u0930\u092e\u094d \u0924\u092a\u094d\u092f\u0928\u094d\u0924\u0947 \u092f\u0947 \u0924\u092a\u094b \u091c\u0928\u093e\u0903 \u0964\n\u0926\u092e\u094d\u092d\u093e\u0939\u0902\u0915\u093e\u0930 \u0938\u092e\u094d\u092f\u0941\u0915\u094d\u0924\u093e\u0903 \u0915\u093e\u092e \u0930\u093e\u0917 \u092c\u0932\u093e\u0928\u094d\u0935\u093f\u0924\u093e\u0903 \u0965 \u096b \u0965\n\u0915\u0930\u094d\u0936\u092f\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u092e\u094d \u0905\u091a\u0947\u0924\u0938\u0903 \u0964\n\u092e\u093e\u092e\u094d \u091a\u0948\u0935\u093e\u0928\u094d\u0924\u0903 \u0936\u0930\u0940\u0930\u0938\u094d\u0925\u092e\u094d \u0924\u093e\u0928\u094d \u0935\u093f\u0926\u094d\u092f\u093e\u0938\u0941\u0930 \u0928\u093f\u0936\u094d\u091a\u092f\u093e\u0928\u094d \u0965 \u096c \u0965","People who are associated with hypocrisy and arrogance find their strength in desire and pleasure. They torment themselves with awful struggle, going against My instructions in the scriptures. They attenuate the colony of elements present as the body along with Me, present as the core of the body. They are lifeless. Know them as people who have resolved to disregard My instructions."],t.w)
B.PE=new A.d(B.c,["\u0906\u0939\u093e\u0930\u0938\u094d\u0924\u094d\u0935\u092a\u093f \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u094b \u092d\u0935\u0924\u093f \u092a\u094d\u0930\u093f\u092f\u0903 \u0964\n\u092f\u091c\u094d\u091e\u0903 \u0924\u092a\u0903 \u0924\u0925\u093e \u0926\u093e\u0928\u092e\u094d \u0924\u0947\u0937\u093e\u092e\u094d \u092d\u0947\u0926\u092e\u094d \u0907\u092e\u092e\u094d \u0936\u0943\u0923\u0941 \u0965 \u096d \u0965","Everyone\u2019s favorite food also falls into three categories. Same is the case with worship, discipline and charity. Listen to the distinctions between them."],t.w)
B.Ng=new A.d(B.c,["\u0906\u092f\u0941\u0903 \u0938\u0924\u094d\u0935 \u092c\u0932\u093e\u0930\u094b\u0917\u094d\u092f \u0938\u0941\u0916 \u092a\u094d\u0930\u0940\u0924\u093f \u0935\u093f\u0935\u0930\u094d\u0927\u0928\u0903 \u0964\n\u0930\u0938\u094d\u092f\u093e\u0903 \u0938\u094d\u0928\u093f\u0917\u094d\u0927\u093e\u0903 \u0938\u094d\u0925\u093f\u0930\u093e \u0939\u0943\u0926\u094d\u092f\u093e \u0906\u0939\u093e\u0930\u093e\u0903 \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915 \u092a\u094d\u0930\u093f\u092f\u093e\u0903 \u0965 \u096e \u0965","The favorite food of people in the sattva quality enhances longevity; it enhances the mind, its strength, health, well-being and love. They are tasty, being mild and smooth, preserving and provide comfort to the mind."],t.w)
B.L0=new A.d(B.c,["\u0915\u091f\u094d\u0935\u092e\u094d\u0932 \u0932\u0935\u0923 \u0905\u0924\u094d\u092f\u0941\u0937\u094d\u0923 \u0924\u0940\u0915\u094d\u0937\u094d\u0923 \u0930\u0942\u0915\u094d\u0937 \u0935\u093f\u0926\u093e\u0939\u093f\u0928\u0903 \u0964\n\u0906\u0939\u093e\u0930\u093e \u0930\u093e\u091c\u0938\u0938\u094d\u092f \u0907\u0937\u094d\u091f\u093e \u0926\u0941\u0903\u0916 \u0936\u094b\u0915\u093e\u092e\u092f \u092a\u094d\u0930\u0926\u093e\u0903 \u0965 \u096f \u0965","The favorite foods of a person in rajas are those that are difficult, giving distress and indigestion. They are pungent, sour, salty, full of heat, sharp and rough to the taste, having scorching effects."],t.w)
B.JQ=new A.d(B.c,["\u092f\u093e\u0924\u092f\u093e\u092e\u092e\u094d \u0917\u0924\u0930\u0938\u092e\u094d \u092a\u0942\u0924\u093f \u092a\u0930\u094d\u092f\u0941\u0937\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0909\u091a\u094d\u091b\u093f\u0937\u094d\u091f\u092e\u094d \u0905\u092a\u093f \u091a\u093e\u092e\u0947\u0927\u094d\u092f\u092e\u094d \u092d\u094b\u091c\u0928\u092e\u094d \u0924\u093e\u092e\u0938 \u092a\u094d\u0930\u093f\u092f\u092e\u094d \u0965 \u0967\u0966 \u0965","Creatures that are in tamas like to eat food that is aged, having lost its natural flavor, foul-smelling, stale, even left-over fragments and other dirty things."],t.w)
B.Qj=new A.d(B.c,["\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u091c\u094d\u091e\u094b \u0935\u093f\u0927\u093f \u0926\u0943\u0937\u094d\u091f\u094b \u092f \u0907\u091c\u094d\u092f\u0924\u0947 \u0964\n\u092f\u0937\u094d\u091f\u0935\u094d\u092f\u092e\u094d \u090f\u0935\u0947\u0924\u093f \u092e\u0928\u0903 \u0938\u092e\u093e\u0927\u093e\u092f \u0938 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u0903 \u0965 \u0967\u0967 \u0965","The worship that is offered in devotion, devoid of expectations, done with consideration to the methods in the scriptures, with the mind being content that 'I just need to worship' - This worship is in sattva ."],t.w)
B.R2=new A.d(B.c,["\u0905\u092d\u093f\u0938\u0902\u0927\u093e\u092f \u0924\u0941 \u092b\u0932\u092e\u094d \u0926\u092e\u094d\u092d\u093e\u0930\u094d\u0925\u092e\u094d \u0905\u092a\u093f \u091a\u0948\u0935 \u092f\u0924\u094d \u0964\n\u0907\u091c\u094d\u092f\u0924\u0947 \u092d\u0930\u0924 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0924\u092e\u094d \u092f\u091c\u094d\u091e\u092e\u094d \u0935\u093f\u0926\u094d\u0927\u093f \u0930\u093e\u091c\u0938\u092e\u094d \u0965 \u0967\u0968 \u0965","Arjuna, worship that is performed with attachment towards expectations or even just to show-off - know that to be in the quality of rajas ."],t.w)
B.M0=new A.d(B.c,["\u0935\u093f\u0927\u093f\u0939\u0940\u0928\u092e\u094d \u0905\u0938\u0943\u0937\u094d\u091f\u093e\u0928\u094d\u0928\u092e\u094d \u092e\u0928\u094d\u0924\u094d\u0930\u0939\u0940\u0928\u092e\u094d \u0905\u0926\u0915\u094d\u0937\u093f\u0923\u092e\u094d \u0964\n\u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0935\u093f\u0930\u0939\u093f\u0924\u092e\u094d \u092f\u091c\u094d\u091e\u092e\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u0969 \u0965","A ritual that disregards all methods with inappropriate materials, devoid of prayer and offering done without focus is condemned to be in the quality of tamas ."],t.w)
B.J1=new A.d(B.c,["\u0926\u0947\u0935 \u0926\u094d\u0935\u093f\u091c \u0917\u0941\u0930\u0941 \u092a\u094d\u0930\u093e\u091c\u094d\u091e \u092a\u0942\u091c\u0928\u092e\u094d \u0936\u094c\u091a\u092e\u094d \u0906\u0930\u094d\u091c\u0935\u092e\u094d \u0964\n\u092c\u094d\u0930\u0939\u094d\u092e\u091a\u0930\u094d\u092f\u092e\u094d \u0905\u0939\u093f\u0902\u0938\u093e \u091a \u0936\u093e\u0930\u0940\u0930\u092e\u094d \u0924\u092a \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096a \u0965","Respecting the divine, the student, the teacher and those who know; being clean; being true to yourself; being immaculate; without the intention of causing harm - these are called the discipline of the body."],t.w)
B.Jw=new A.d(B.c,["\u0905\u0928\u0941\u0926\u094d\u0935\u0947\u0917\u0915\u0930\u092e\u094d \u0935\u093e\u0915\u094d\u092f\u092e\u094d \u0938\u0924\u094d\u092f\u092e\u094d \u092a\u094d\u0930\u093f\u092f \u0939\u093f\u0924\u092e\u094d \u091a \u092f\u0924\u094d \u0964\n\u0938\u094d\u0935\u093e\u0927\u094d\u092f\u093e\u092f\u093e\u092d\u094d\u092f\u0938\u0928\u092e\u094d \u091a\u0948\u0935 \u0935\u093e\u0915\u094d \u092e\u092f\u092e\u094d \u0924\u092a \u0909\u091a\u094d\u092f\u0924\u0947 \u0965 \u0967\u096b \u0965","A sentence that doesn't cause agitation, is authentic, liked and comforting, with a study of the Self built into it - this is known as discipline of speech."],t.w)
