B.Jv=new A.d(B.c,["\u0936\u094d\u0930\u0926\u094d\u0927\u092f\u093e \u092a\u0930\u092f\u093e \u0924\u092a\u094d\u0924\u092e\u094d \u0924\u092a\u0903 \u0924\u0924\u094d \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u092e\u094d \u0928\u0930\u0948\u0903 \u0964\n\u0905\u092b\u0932\u093e\u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u092f\u0941\u0915\u094d\u0924\u0948\u0903 \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u092a\u0930\u093f\u091a\u0915\u094d\u0937\u0924\u0947 \u0965 \u0967\u096d \u0965","When these three disciplines are implemented as The Lord's worship, by people with supreme focus, without being bogged down by expectations, - this is seen as being in the quality of sattva ."],t.w)
B.Kn=new A.d(B.c,["\u0938\u0924\u094d\u0915\u093e\u0930 \u092e\u093e\u0928 \u092a\u0942\u091c\u093e\u0930\u094d\u0925\u092e\u094d \u0924\u092a\u094b \u0926\u092e\u094d\u092d\u0947\u0928 \u091a\u0948\u0935 \u092f\u0924\u094d \u0964\n\u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u0924\u0924\u094d \u0907\u0939 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u091a\u0932\u092e\u094d \u0905\u0927\u094d\u0930\u0941\u0935\u092e\u094d \u0965 \u0967\u096e \u0965","Discipline that's practiced to be revered, to gain fame, respect, pride and with the only aim of showing-off - such discipline here is said to be in the quality of rajas . It is perishable and unstable."],t.w)
B.Nx=new A.d(B.c,["\u092e\u0942\u0922 \u0917\u094d\u0930\u093e\u0939\u0947\u0923 \u0906\u0924\u094d\u092e\u0928\u094b \u092f\u0924\u094d \u092a\u0940\u0921\u092f\u093e \u0915\u094d\u0930\u093f\u092f\u0924\u0947 \u0924\u092a\u0903 \u0964\n\u092a\u0930\u0938\u094d\u092f\u094b\u0924\u094d\u0938\u093e\u0926\u0928\u093e\u0930\u094d\u0925\u092e\u094d \u0935\u093e \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u0967\u096f \u0965","Discipline that's practiced with confused perceptions to torment oneself, or practiced in order to put aside others - such discipline is said to be in the quality of tamas ."],t.w)
B.Pj=new A.d(B.c,["\u0926\u093e\u0924\u0935\u094d\u092f\u092e\u094d \u0907\u0924\u093f \u092f\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0926\u0940\u092f\u0924\u0947 \u0905\u0928\u0941\u092a\u0915\u093e\u0930\u093f\u0923\u0947 \u0964\n\u0926\u0947\u0936\u0947 \u0915\u093e\u0932\u0947 \u091a \u092a\u093e\u0924\u094d\u0930\u0947 \u091a \u0924\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0938\u093e\u0924\u094d\u0935\u093f\u0915\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u092e\u094d \u0965 \u0968\u0966 \u0965","Possessions that are given to the deserving who have not been of favor or assistance, at the appropriate place and time, with conviction - This charity is known to be in the quality of sattva ."],t.w)
B.Ll=new A.d(B.c,["\u092f\u0924\u094d\u0924\u0941 \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u092a\u0915\u093e\u0930\u093e\u0930\u094d\u0925\u092e\u094d \u092b\u0932\u092e\u094d \u0909\u0926\u094d\u0926\u093f\u0936\u094d\u092f \u0935\u093e \u092a\u0941\u0928\u0903 \u0964\n\u0926\u0940\u092f\u0924\u0947 \u091a \u092a\u0930\u093f\u0915\u094d\u0932\u093f\u0937\u094d\u091f\u092e\u094d \u0924\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0930\u093e\u091c\u0938\u092e\u094d \u0938\u094d\u092e\u0943\u0924\u092e\u094d \u0965 \u0968\u0967 \u0965","On the other hand, when it is given as return for past favors or in anticipation of future favors, or again, targeting expectations, it is done unwillingly, with trouble and exhaustion. This act of giving is known to be in the quality of rajas ."],t.w)
B.JP=new A.d(B.c,["\u0905\u0926\u0947\u0936\u0915\u093e\u0932\u0947 \u092f\u0924\u094d \u0926\u093e\u0928\u092e\u094d \u0905\u092a\u093e\u0924\u094d\u0930\u0947\u092d\u094d\u092f\u0903 \u091a \u0926\u0940\u092f\u0924\u0947 \u0964\n\u0905\u0938\u0924\u094d\u0915\u0943\u0924\u092e\u094d \u0905\u0935\u091c\u094d\u091e\u093e\u0924\u092e\u094d \u0924\u0924\u094d \u0924\u093e\u092e\u0938\u092e\u094d \u0909\u0926\u093e\u0939\u0943\u0924\u092e\u094d \u0965 \u0968\u0968 \u0965","That which is given to the undeserving, without an appropriate place and time without respect, with contempt, it is said to be in the quality of tamas ."],t.w)
B.Jo=new A.d(B.c,["\u0913\u092e\u094d \u0924\u0924\u094d \u0938\u0924\u094d \u0907\u0924\u093f \u0928\u093f\u0930\u094d\u0926\u0947\u0936\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0923\u0903 \u0924\u094d\u0930\u093f\u0935\u093f\u0927\u0903 \u0938\u094d\u092e\u0943\u0924\u0903 \u0964\n\u092c\u094d\u0930\u093e\u0939\u094d\u092e\u0923\u093e\u0903 \u0924\u0947\u0928 \u0935\u0947\u0926\u093e\u0936\u094d\u091a \u092f\u091c\u094d\u091e\u093e\u0903 \u091a \u0935\u093f\u0939\u093f\u0924\u093e\u0903 \u092a\u0941\u0930\u093e \u0965 \u0968\u0969 \u0965","'Om', 'tat', 'sat' are three specific directives, prescribed for all activities in the Lord's scriptures. The Vedas, people in the quest for the Lord and the way of worship were specified long ago with these sounds."],t.w)
B.LX=new A.d(B.c,["\u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0913\u092e\u094d \u0907\u0924\u093f \u0909\u0926\u093e\u0939\u0943\u0924\u094d\u092f \u092f\u091c\u094d\u091e \u0926\u093e\u0928 \u0924\u092a\u0903 \u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u0964\n\u092a\u094d\u0930\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u0935\u093f\u0927\u093e\u0928\u094b\u0915\u094d\u0924\u093e\u0903 \u0938\u0924\u0924\u092e\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0935\u093e\u0926\u093f\u0928\u093e\u092e\u094d \u0965 \u0968\u096a \u0965","That's why the activities of worship, charity and discipline are always started by saying the sound of Om, as specified for people who follow the Vedas."],t.w)
B.Lg=new A.d(B.c,["\u0924\u0926\u093f\u0924\u093f \u0905\u0928\u092d\u093f\u0938\u0928\u094d\u0927\u093e\u092f \u092b\u0932\u092e\u094d \u092f\u091c\u094d\u091e \u0924\u092a\u0903 \u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u0964\n\u0926\u093e\u0928\u0915\u094d\u0930\u093f\u092f\u093e\u0903 \u091a \u0935\u093f\u0935\u093f\u0927\u093e\u0903 \u0915\u094d\u0930\u093f\u092f\u0928\u094d\u0924\u0947 \u092e\u094b\u0915\u094d\u0937 \u0915\u093e\u0902\u0915\u094d\u0937\u093f\u092d\u093f\u0903 \u0965 \u0968\u096b \u0965","Activities in the form of worship, discipline and various kinds of charitable deeds are done without being bogged down by expectations by those who desire moksha , saying the word 'tat'."],t.w)
