B.PT=new A.d(B.c,["\u0928 \u091a \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u092e\u0928\u0941\u0937\u094d\u092f\u0947\u0937\u0941 \u0915\u0936\u094d\u091a\u093f\u0928\u094d \u092e\u0947 \u092a\u094d\u0930\u093f\u092f\u0915\u0943\u0924\u094d\u0924\u092e\u0903 \u0964\n\u092d\u0935\u093f\u0924\u093e \u0928 \u091a \u092e\u0947 \u0924\u0938\u094d\u092e\u093e\u0924\u094d \u0905\u0928\u094d\u092f\u0903 \u092a\u094d\u0930\u093f\u092f\u0924\u0930\u094b \u092d\u0941\u0935\u093f \u0965 \u096c\u096f \u0965","Moreover, there is nobody among humans who has done something more likeable for Me than such a person. Further, there isn't going to be anyone else who is dearer to Me on earth."],t.w)
B.LN=new A.d(B.c,["\u0905\u0927\u094d\u092f\u0947\u0937\u094d\u092f\u0924\u0947 \u091a \u092f \u0907\u092e\u092e\u094d \u0927\u0930\u094d\u092e\u094d\u092f\u092e\u094d \u0938\u0902\u0935\u093e\u0926\u092e\u094d \u0906\u0935\u092f\u094b\u0903 \u0964\n\u091c\u094d\u091e\u093e\u0928 \u092f\u091c\u094d\u091e\u0947\u0928 \u0924\u0947\u0928\u093e\u0939\u092e\u094d \u0907\u0937\u094d\u091f\u0903 \u0938\u094d\u092f\u093e\u092e\u094d \u0907\u0924\u093f \u092e\u0947 \u092e\u0924\u093f\u0903 \u0965 \u096d\u0966 \u0965","I consider Myself to be cherished by the pursuit of knowledge, performed by the person who studies this uplifting conversation of ours."],t.w)
